import React from "react";
import { useState } from "react";
import "./AboutSub6.css";

function AboutSub6() {
  const [name, setName] = useState(""); //as it is string we use ""
  const [branch, setBranch] = useState("");
  const [feedback, setFeedback] = useState("");

  return (
    <>
      <div className="controlClassFeedback">
        <div className="feedbackForm">
          <div className="inputBox" id="inp1Feed">
            <input
              type="text"
              required="required"
              onChange={(event) => {
                setName(event.target.value);
              }}
            />
            <span>Name</span>
          </div>
          <div className="inputBox" id="inp2Feed">
            <input
              type="text"
              required="required"
              onChange={(event) => {
                setBranch(event.target.value);
              }}
            />
            <span>Branch</span>
          </div>
          <div className="inputBox" id="inp3Feed">
            <textarea
              required="required"
              cols="30"
              rows="10"
              onChange={(event) => {
                setFeedback(event.target.value);
              }}
            ></textarea>
            <span>Feedback</span>
          </div>
          <div>
            <button className="submitFeed">SUBMIT</button>
            {/* <input onClick={displayInfo} type="submit" value="SUBMIT" className="submitFeed" /> */}
          </div>
        </div>
      </div>
    </>
  );
}

export default AboutSub6;
